  [],\n\t\"revision_timestamp\": \"2016-02-29T01:35:05.644960\",\n\t\"name\": \"ph-alkalinity-temperature-salinity-and-other-variables-collected-from-profile-observations-usin\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0112927 includes chemical,
  discrete sample, physical and time series profile data collected from HESPERIDES
  in the North Atlantic Ocean and Strait of Gibraltar from 2008-10-06 to 2008-10-12.
  These data include ALKALINITY, DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE,
  Potential temperature (theta), SALINITY, SILICATE, WATER TEMPERATURE and pH. The
  instruments used to collect these data include Alkalinity titrator, CTD, Spectrophotometer
  for pH measrement and bottle.nnThese data were collected by Aida F. Rios of Instituto
  de Investigaciones Marinas; Departamento de Oceanograffa and Emma Huertas of Marine
  Sciences Institute, Andalucia as part of the GIFT_29HE20081006 data set. CDIAC assigned
  the following cruise ID(s) to this data set: GIFT_29HE20081006 and P3A2.nnThe Global
  CO2 Time-series and Moorings Project involves international groups from 18 countries
  who have mounted sensors on moored buoys to provide high resolution time-series
  measurements of atmospheric boundary layer and surface ocean CO2 partial pressure
  (pCO2). The CO2 Time-series and Moorings Project is coordinated by UNESCO International
  Ocean Carbon Coordination Project (IOCCP).\",\n\t\"license_title\": null,\n\t\"extras\":
